var express = require("express");
var bodyParser = require("body-parser");

var PORT = process.env.PORT || 8000;
var app = express();


app.use(bodyParser.urlencoded({extended:true}));
app.set("view engine", "ejs");

var albums =[
    {artist:"Nipsey Hussle", image:"data:image/jpeg;base64,"},
    {artist:"Young Dolph",image:"data:image/jpeg;base64,"},
    {artist:"Arcade Fire", image:"data:image/jpeg;base64,"}
];


app.listen(PORT, function() {
    console.log("Listening on port:%s", PORT);
  });

app.get("/",function(req,res){
    res.render("landing");
});

app.get("/albums",function(req,res){
    

    res.render("albums",{albums:albums});
});


app.post("/albums",function(req,res){
    // res.send("you hit the post route");
    var artist = req.body.artist;
    var image = req.body.image;
    var newAlbum = {artist:artist, image:image};
    albums.push(newAlbum);

    res.redirect("/albums");
});

app.get("/albums/new",function(req,res){
    res.render("new.ejs");
})
    